import React from "react";
import "./Note.scss";

const Note = () => {
  return (
    <div className="note">
      <div className="note__header">
        <div className="note__header-date">
          last edited on April 10, 2021
        </div>
        <div className="noye__header-action-btn">
          <div className="action-btn">

          </div>
        </div>
      </div>
      <div className="note__body">

      </div>
    </div>
  );
};

export default Note;
